export const lineChartData = {
    labels: [  //shown on the x axis
        "Monday",
        "Tuesday",
        "Wednesday",
        "Thursday",
        "Friday",
        "Saturday",
        "Sunday"
    ],
    datasets: [  //shown on the y axis
        {
            label: "Steps by Ethan",
            data: [3000,4000,5000,6000,7000,8000,9000],
            borderColor: "rgba(75, 192, 192, 1)",
        },
        {
            label: "Steps by Ethan",
            data: [3000,4000,5000,6000,7000,8000,9000],
            borderColor: "rgba(75, 192, 192, 1)",
        }
    ]
}
